; // 32-bit goto b6; b5: rdx = 1; // 32-bit b6: rax = rdx; // 32-bit // pop rbx rbp r12 return; }\"]},\"1384\":{\"h\":\"xxxxxxxxxx5 1int string_length(char* rdi) {2 char* rdx = rdi;3 while (*rdx) ++rdi;4 return rdx - rdi; // rax5}c\",\"t\":[\"int strings_not_equal(char* rdi, char* rsi) { if (string_length(rdi) != string_length(rsi)) return 1; for (char *rbx = rdi, *rbp = rsi; *rbx; ++rbx, ++rbp) { if (*rbx != *rbp) return 1; } return 0; }\"]},\"1385\":{\"c\":[\"Course Work\"]},\"1386\":{\"h\":\"Linux Device Drivers | Allocating Memory\"},\"1387\":{\"h\":\"<linux/slab.h>\",\"t\":[\"void *kmalloc(size_t size, int flags); void kfree(void *obj);\",\"The most frequently used interface to memory allocation.\"]},\"1388\":{\"h\":\"<linux/mm.h>\",\"t\":[\"GFP_USER GFP_KERNEL GFP_NOFS GFP_NOIO GFP_ATOMIC\",\"Flags that control how memory allocations are performed, from the least restrictive to the most. The GFP_USER and GFP_KERNEL priorities allow the current process to be put to sleep to satisfy the request. GFP_NOFS and GFP_NOIO disable filesystem operations and all I/O operations, respectively, while GFP_ATOMIC allocations cannot sleep at all.\",\"__GFP_DMA __GFP_HIGHMEM __GFP_COLD __GFP_NOWARN __GFP_HIGH __GFP_REPEAT __GFP_NOFAIL __GFP_NORETRY\",\"These flags modify the kernelâ€™s behavior when allocating memory.\"]},\"1389\":{\"h\":\"<linux/malloc.h>\",\"t\":[\"kmem_cache_t *kmem_cache_create(char *name, size_t size, size_t offset, unsigned long flags, constructor(), destructor()); int kmem_cache_destroy(kmem_cache_t *cache);\",\"Create and destroy a slab cache. The cache can be used to allocate several objects of the same size.\",\"SLAB_NO_REAP SLAB_HWCACHE_ALIGN SLAB_CACHE_DMA\",\"Flags that can be specified while creating a cache.\",\"SLAB_CTOR_ATOMIC SLAB_CTOR_CONSTRUCTOR\",\"Flags that the allocator can pass to the constructor and the destructor functions.\",\"void *kmem_cache_alloc(kmem_cache_t *cache, int flags); void kmem_cache_free(kmem_cache_t *cache, const void *obj);\",\"Allocate and release a single object from the cache.\"]},\"1390\":{\"h\":\"Files\",\"t\":[\"/proc/slabinfo\",\"A virtual file containing statistics on slab cache usage.\"]},\"1391\":{\"h\":\"<linux/mempool.h>\",\"t\":[\"mempool_t *mempool_create(int min_nr, mempool_alloc_t *alloc_fn, mempool_free_t *free_fn, void *data); void mempool_destroy(mempool_t *pool);\",\"Functions for the creation of memory pools, which try to avoid memory allocation failures by keeping an â€œemergency listâ€ of allocated items.\",\"void *mempool_alloc(mempool_t *pool, int gfp_mask); void mempool_free(void *element, mempool_t *pool);\",\"Functions for allocating items from (and returning them to) memory pools.\",\"unsigned long get_zeroed_page(int flags); unsigned long __get_free_page(int flags); unsigned long __get_free_pages(int flags, unsigned long order);\",\"The page-oriented allocation functions. get_zeroed_page returns a single, zero-filled page. All the other versions of the call do not initialize the contents of the returned page(s).\",\"int get_order(unsigned long size);\",\"Returns the allocation order associated to size in the current platform, according to PAGE_SIZE. The argument must be a power of two, and the return value is at least 0.\",\"void free_page(unsigned long addr); void free_pages(unsigned long addr, unsigned long order);\",\"Functions that release page-oriented allocations.\",\"struct page *alloc_pages_node(int nid, unsigned int flags, unsigned int order); struct page *alloc_pages(unsigned int flags, unsigned int order); struct page *alloc_page(unsigned int flags);\",\"All variants of the lowest-level page allocator in the Linux kernel.\",\"void __free_page(struct page *page); void __free_pages(struct page *page, unsigned int order); void free_hot_page(struct page *page); void free_cold_page(struct page *page);\",\"Various ways of freeing pages allocated with one of the forms of alloc_page.\"]},\"1392\":{\"h\":\"<linux/vmalloc.h>\",\"t\":[\"void * vmalloc(unsigned long size); void vfree(void * addr);\"]},\"1393\":{\"h\":\"<asm/io.h>\",\"t\":[\"void * ioremap(unsigned long offset, unsigned long size); void iounmap(void *addr);\",\"Functions that allocate or free a contiguous virtual address space. ioremap accesses physical memory through virtual addresses, while vmalloc allocates free pages. Regions mapped with ioremap are freed with iounmap, while pages obtained from vmalloc are released with vfree.\"]},\"1394\":{\"h\":\"<linux/percpu.h>\",\"t\":[\"DEFINE_PER_CPU(type, name); DECLARE_PER_CPU(type, name);\",\"Macros that define and declare per-CPU variables.\",\"per_cpu(variable, int cpu_id) get_cpu_var(variable) put_cpu_var(variable)\",\"Macros that provide access to statically declared per-CPU variables.\",\"void *alloc_percpu(type); void *__alloc_percpu(size_t size, size_t align); void free_percpu(void *variable);\",\"Functions that perform runtime allocation and freeing of per-CPU variables.\",\"int get_cpu(); void put_cpu(); per_cpu_ptr(void *variable, int cpu_id)\",\"get_cpu obtains a reference to the current processor (therefore, preventing preemption and movement to another processor) and returns the ID number of the processor; put_cpu returns that reference. To access a dynamically allocated per-CPU variable, use per_cpu_ptr with the ID of the CPU whose version should be accessed. Manipulations of the current CPUâ€™s version of a dynamic, per-CPU variable should probably be surrounded by calls to get_cpu and put_cpu.\"]},\"1395\":{\"h\":\"<linux/bootmem.h>\",\"t\":[\"void *alloc_bootmem(unsigned long size); void *alloc_bootmem_low(unsigned long size); void *alloc_bootmem_pages(unsigned long size); void *alloc_bootmem_low_pages(unsigned long size); void free_bootmem(unsigned long addr, unsigned long size);\",\"Functions (which can be used only by drivers directly linked into the kernel) that perform allocation and freeing of memory at system bootstrap time.\"]},\"1396\":{\"c\":[\"Research\"]},\"1397\":{\"h\":\"Linux Device Drivers | Building and Running Modules\"},\"1398\":{\"h\":\"Utilities\",\"t\":[\"insmod modprobe rmmod\",\"User-space utilities that load modules into the running kernels and remove them.\"]},\"1399\":{\"h\":\"<linux/init.h>\",\"t\":[\"module_init(init_function); module_exit(cleanup_function);\",\"Macros that designate a moduleâ€™s initialization and cleanup functions.\",\"__init __initdata __exit __exitdata\",\"Markers for functions (__init and __exit) and data (__initdata and __exitdata) that are only used at module initialization or cleanup time. Items marked for initialization may be discarded once initialization completes; the exit items may be discarded if module unloading has not been configured into the kernel. These markers work by causing the relevant objects to be placed in a special ELF section in the executable file.\"]},\"1400\":{\"h\":\"<linux/sched.h>\",\"t\":[\"One of the most important header files. This file contains definitions of much of the kernel API used by the driver, including functions for sleeping and numerous variable declarations.\",\"struct task_struct *current;\",\"The current process.\",\"current->pid current->comm\",\"The process ID and command name for the current process.\"]},\"1401\":{\"h\":\"Makefile\",\"t\":[\"obj-m\",\"A makefile symbol used by the kernel build system to determine which modules should be built in the current directory.\"]},\"1402\":{\"h\":\"Files\",\"t\":[\"/sys/module /proc/modules\",\"/sys/module is a sysfs directory hierarchy containing information on currently-loaded modules. /proc/modules is the older, single-file version of that information. Entries contain the module name, the amount of memory each module occupies, and the usage count. Extra strings are appended to each line to specify flags that are currently active for the module.\",\"vermagic.o\",\"An object file from the kernel source directory that describes the environment a module was built for.\"]},\"1403\":{\"h\":\"<linux/module.h>\",\"t\":[\"Required header. It must be included by a module source.\"]},\"1404\":{\"h\":\"<linux/version.h>\",\"t\":[\"A header file containing information on the version of the kernel being built.\",\"LINUX_VERSION_CODE\",\"Integer macro, useful to #ifdef version dependencies.\",\"EXPORT_SYMBOL(symbol); EXPORT_SYMBOL_GPL(symbol);\",\"Macro used to export a symbol to the kernel. The second form limits use of the exported symbol to GPL-licensed modules.\",\"MODULE_AUTHOR(author); MODULE_DESCRIPTION(description); MODULE_VERSION(version_string); MODULE_DEVICE_TABLE(table_info); MODULE_ALIAS(alternate_name);\",\"Place documentation on the module in the object file.\",\"MODULE_LICENSE(license);\",\"Declare the license governing this module.\"]},\"1405\":{\"h\":\"<linux/moduleparam.h>\",\"t\":[\"module_param(variable, type, perm);\",\"Macro that creates a module parameter that can be adjusted by the user when the module is loaded (or at boot time for built-in code). The type can be one of bool, charp, int, invbool, long, short, ushort, uint, ulong, or intarray.\"]},\"1406\":{\"h\":\"<linux/kernel.h>\",\"t\":[\"int printk(const char * fmt, ...);\",\"The analogue of printf for kernel code.\"]},\"1407\":{\"c\":[\"Research\"]},\"1408\":{\"h\":\"Linux Device Drivers | Char Drivers | File Operations\",\"t\":[\"#include <linux/fs.h> struct file_operations { ... };\"]},\"1409\":{\"h\":\"owner\",\"t\":[\"struct module *owner\",\"The first file_operations field is not an operation at all; it is a pointer to the module that â€œownsâ€ the structure. This field is used to prevent the module from being unloaded while its operations are in use. Almost all the time, it is simply initialized to THIS_MODULE, a macro defined in <linux/module.h>.\"]},\"1410\":{\"h\":\"llseek\",\"t\":[\"loff_t (*llseek) (struct file *, loff_t, int);\",\"The llseek method is used to change the current read/write position in a file, and the new position is returned as a (positive) return value. The loff_t parameter is a â€œlong offsetâ€ and is at least 64 bits wide even on 32-bit platforms. Errors are signaled by a negative return value. If this function pointer is NULL, seek calls will modify the position counter in the file structure (described in the section â€œThe file Structureâ€) in potentially unpredictable ways.\"]},\"1411\":{\"h\":\"read\",\"t\":[\"ssize_t (*read) (struct file *, char __user *, size_t, loff_t *);\",\"Used to retrieve data from the device. A null pointer in this position causes the read system call to fail with -EINVAL (â€œInvalid argumentâ€). A nonnegative return value represents the number of bytes successfully read (the return value is a â€œsigned sizeâ€ type, usually the native integer type for the target platform).\"]},\"1412\":{\"h\":\"aio_read\",\"t\":[\"ssize_t (*aio_read)(struct kiocb *, char __user *, size_t, loff_t);\",\"Initiates an asynchronous read â€” a read operation that might not complete before the function returns. If this method is NULL, all operations will be processed (synchronously) by read instead.\"]},\"1413\":{\"h\":\"write\",\"t\":[\"ssize_t (*write) (struct file *, const char __user *, size_t, loff_t *);\",\"Sends data to the device. If NULL, -EINVAL is returned to the program calling the write system call. The return value, if nonnegative, represents the number of bytes successfully written.\"]},\"1414\":{\"h\":\"aio_write\",\"t\":[\"ssize_t (*aio_write) (struct kiocb *, const char __user *, size_t, loff_t *);\",\"Initiates an asynchronous write operation on the device.\"]},\"1415\":{\"h\":\"readdir\",\"t\":[\"int (*readdir) (struct file *, void *, filldir_t);\",\"This field should be NULL for device files; it is used for reading directories and is useful only for filesystems.\"]},\"1416\":{\"h\":\"poll\",\"t\":[\"unsigned int (*poll) (struct file *, struct poll_table_struct *);\",\"The poll method is the back end of three system calls: poll, epoll, and select, all of which are used to query whether a read or write to one or more file descriptors would block. The poll method should return a bit mask indicating whether nonblocking reads or writes are possible, and, possibly, provide the kernel with information that can be used to put the calling process to sleep until I/O becomes possible. If a driver leaves its poll method NULL, the device is assumed to be both readable and writable without blocking.\"]},\"1417\":{\"h\":\"ioctl\",\"t\":[\"int (*ioctl) (struct inode *, struct file *, unsigned int, unsigned long);\",\"The ioctl system call offers a way to issue device-specific commands (such as formatting a track of a floppy disk, which is neither reading nor writing). Additionally, a few ioctl commands are recognized by the kernel without referring to the fops table. If the device doesnâ€™t provide an ioctl method, the system call returns an error for any request that isnâ€™t predefined (-ENOTTY, â€œNo such ioctl for deviceâ€).\"]},\"1418\":{\"h\":\"mmap\",\"t\":[\"int (*mmap) (struct file *, struct vm_area_struct *);\",\"mmap is used to request a mapping of device memory to a processâ€™s address space. If this method is NULL, the mmap system call returns -ENODEV.\"]},\"1419\":{\"h\":\"open\",\"t\":[\"int (*open) (struct inode *, struct file *);\",\"Though this is always the first operation performed on the device file, the driver is not required to declare a corresponding method. If this entry is NULL, opening the device always succeeds, but your driver isnâ€™t notified.\"]},\"1420\":{\"h\":\"flush\",\"t\":[\"int (*flush) (struct file *);\",\"The flush operation is invoked when a process closes its copy of a file descriptor for a device; it should execute (and wait for) any outstanding operations on the device. This must not be confused with the fsync operation requested by user programs. Currently, flush is used in very few drivers; the SCSI tape driver uses it, for example, to ensure that all data written makes it to the tape before the device is closed. If flush is NULL, the kernel simply ignores the user application request.\"]},\"1421\":{\"h\":\"release\",\"t\":[\"int (*release) (struct inode *, struct file *);\",\"This operation is invoked when the file structure is being released. Like open, release can be NULL.[1]\"]},\"1422\":{\"h\":\"fsync\",\"t\":[\"int (*fsync) (struct file *, struct dentry *, int);\",\"This method is the back end of the fsync system call, which a user calls to flush any pending data. If this pointer is NULL, the system call returns -EINVAL.\"]},\"1423\":{\"h\":\"aio_fsync\",\"t\":[\"int (*aio_fsync)(struct kiocb *, int);\",\"This is the asynchronous version of the fsync method.\"]},\"1424\":{\"h\":\"fasync\",\"t\":[\"int (*fasync) (int, struct file *, int);\",\"This operation is used to notify the device of a change in its FASYNC flag. Asynchronous notification is an advanced topic and is described in Chapter 6. The field can be NULL if the driver doesnâ€™t support asynchronous notification.\"]},\"1425\":{\"h\":\"lock\",\"t\":[\"int (*lock) (struct file *, int, struct file_lock *);\",\"The lock method is used to implement file locking; locking is an indispensable feature for regular files but is almost never implemented by device drivers.\"]},\"1426\":{\"h\":\"readv\",\"t\":[\"ssize_t (*readv) (struct file *, const struct iovec *, unsigned long, loff_t *); ssize_t (*writev) (struct file *, const struct iovec *, unsigned long, loff_t *);\",\"These methods implement scatter/gather read and write operations. Applications occasionally need to do a single read or write operation involving multiple memory areas; these system calls allow them to do so without forcing extra copy operations on the data. If these function pointers are left NULL, the read and write methods are called (perhaps more than once) instead.\"]},\"1427\":{\"h\":\"sendfile\",\"t\":[\"ssize_t (*sendfile)(struct file *, loff_t *, size_t, read_actor_t, void *);\",\"This method implements the read side of the sendfile system call, which moves the data from one file descriptor to another with a minimum of copying. It is used, for example, by a web server that needs to send the contents of a file out a network connection. Device drivers usually leave sendfileNULL.\"]},\"1428\":{\"h\":\"sendpage\",\"t\":[\"ssize_t (*sendpage) (struct file *, struct page *, int, size_t, loff_t *, int);\",\"sendpage is the other half of sendfile; it is called by the kernel to send data, one page at a time, to the corresponding file. Device drivers do not usually implement sendpage.\"]},\"1429\":{\"h\":\"get_unmapped_area\",\"t\":[\"unsigned long (*get_unmapped_area)(struct file *, unsigned long, unsigned long, unsigned long, unsigned long);\",\"The purpose of this method is to find a suitable location in the processâ€™s address space to map in a memory segment on the underlying device. This task is normally performed by the memory management code; this method exists to allow drivers to enforce any alignment requirements a particular device may have. Most drivers can leave this method NULL.\"]},\"1430\":{\"h\":\"chech_flags\",\"t\":[\"int (*check_flags) (int);\",\"This method allows a module to check the flags passed to an fcntl(F_SETFL...) call.\"]},\"1431\":{\"h\":\"dir_notify\",\"t\":[\"int (*dir_notify) (struct file *, unsigned long);\",\"This method is invoked when an application uses fcntl to request directory change notifications. It is useful only to filesystems; drivers need not implement dir_notify.\",\"Note that release isnâ€™t invoked every time a process calls close. Whenever a file structure is shared (for example, after a fork or a dup), release wonâ€™t be invoked until all copies are closed. If you need to flush pending data when any copy is closed, you should implement the flush method. â†©ï¸\"]},\"1432\":{\"c\":[\"Research\"]},\"1433\":{\"h\":\"Linux Device Drivers | Char Drivers | The file Structure\",\"t\":[\"#include <linux/fs.h> struct file { ... };\"]},\"1434\":{\"h\":\"f_mode\",\"t\":[\"mode_t f_mode;\",\"The file mode identifies the file as either readable or writable (or both), by means of the bits FMODE_READ and FMODE_WRITE. You might want to check this field for read/write permission in your open or ioctl function, but you donâ€™t need to check permissions for read and write, because the kernel checks before invoking your method. An attempt to read or write when the file has not been opened for that type of access is rejected without the driver even knowing about it.\"]},\"1435\":{\"h\":\"f_pos\",\"t\":[\"loff_t f_pos;\",\"The current reading or writing position. loff_t is a 64-bit value on all platforms (long long in gcc terminology). The driver can read this value if it needs to know the current position in the file but should not normally change it; read and write should update a position using the pointer they receive as the last argument instead of acting on filp->f_pos directly. The one exception to this rule is in the llseek method, the purpose of which is to change the file position.\"]},\"1436\":{\"h\":\"f_flags\",\"t\":[\"unsigned int f_flags;\",\"These are the file flags, such as O_RDONLY, O_NONBLOCK, and O_SYNC. A driver should check the O_NONBLOCK flag to see if nonblocking operation has been requested (we discuss nonblocking I/O in the section â€œBlocking and Nonblocking Operationsâ€ in Chapter 6); the other flags are seldom used. In particular, read/write permission should be checked using f_mode rather than f_flags. All the flags are defined in the header <linux/fcntl.h>.\"]},\"1437\":{\"h\":\"f_op\",\"t\":[\"struct file_operations *f_op;\",\"The operations associated with the file. The kernel assigns the pointer as part of its implementation of open and then reads it when it needs to dispatch any operations. The value in filp->f_op is never saved by the kernel for later reference; this means that you can change the file operations associated with your file, and the new methods will be effective after you return to the caller. For example, the code for open associated with major number 1 (/dev/null, /dev/zero, and so on) substitutes the operations in filp->f_op depending on the minor number being opened. This practice allows the implementation of several behaviors under the same major number without introducing overhead at each system call. The ability to replace the file operations is the kernel equivalent of â€œmethod overridingâ€ in object-oriented programming.\"]},\"1438\":{\"h\":\"private_data\",\"t\":[\"void *private_data;\",\"The open system call sets this pointer to NULL before calling the open method for the driver. You are free to make its own use of the field or to ignore it; you can use the field to point to allocated data, but then you must remember to free that memory in the release method before the file structure is destroyed by the kernel. private_data is a useful resource for preserving state information across system calls and is used by most of our sample modules.\"]},\"1439\":{\"h\":\"f_dentry\",\"t\":[\"struct dentry *f_dentry;\",\"The directory entry (dentry) structure associated with the file. Device driver writers normally need not concern themselves with dentry structures, other than to access the inode structure as filp->f_dentry->d_inode.\"]},\"1440\":{\"c\":[\"Research\"]},\"1441\":{\"h\":\"Linux Device Drivers | Char Drivers\"},\"1442\":{\"h\":\"<linux/types.h>\",\"t\":[\"dev_t\",\"dev_t is the type used to represent device numbers within the kernel.\",\"int MAJOR(dev_t dev); int MINOR(dev_t dev);\",\"Macros that extract the major and minor numbers from a device number.\",\"dev_t MKDEV(unsigned int major, unsigned int minor);\",\"Macro that builds a dev_t data item from the major and minor numbers.\"]},\"1443\":{\"h\":\"<linux/fs.h>\",\"t\":[\"The â€œfilesystemâ€ header is the header required for writing device drivers. Many important functions and data structures are declared in here.\",\"int register_chrdev_region(dev_t first, unsigned int count, char *name) int alloc_chrdev_region(dev_t *dev, unsigned int firstminor, unsigned int count, char *name) void unregister_chrdev_region(dev_t first, unsigned int count);\",\"Functions that allow a driver to allocate and free ranges of device numbers. register_chrdev_region should be used when the desired major number is known in advance; for dynamic allocation, use alloc_chrdev_region instead.\",\"int register_chrdev(unsigned int major, const char *name, struct file_operations *fops);\",\"The old (pre-2.6) char device registration routine. It is emulated in the 2.6 kernel but should not be used for new code. If the major number is not 0, it is used unchanged; otherwise a dynamic number is assigned for this device.\",\"int unregister_chrdev(unsigned int major, const char *name);\",\"Function that undoes a registration made with register_chrdev. Both major and the name string must contain the same values that were used to register the driver.\",\"struct file_operations; struct file; struct inode;\",\"Three important data structures used by most device drivers. The file_operations structure holds a char driverâ€™s methods; struct file represents an open file, and struct inode represents a file on disk.\"]},\"1444\":{\"h\":\"<linux/cdev.h>\",\"t\":[\"struct cdev *cdev_alloc(void); void cdev_init(struct cdev *dev, struct file_operations *fops); int cdev_add(struct cdev *dev, dev_t num, unsigned int count); void cdev_del(struct cdev *dev);\",\"Functions for the management of cdev structures, which represent char devices within the kernel.\"]},\"1445\":{\"h\":\"<linux/kernel.h>\",\"t\":[\"container_of(pointer, type, field);\",\"A convenience macro that may be used to obtain a pointer to a structure from a pointer to some other structure contained within it.\"]},\"1446\":{\"h\":\"<asm/uaccess.h>\",\"t\":[\"This include file declares functions used by kernel code to move data to and from user space.\",\"unsigned long copy_from_user (void *to, const void *from, unsigned long count); unsigned long copy_to_user (void *to, const void *from, unsigned long count);\",\"Copy data between user space and kernel space.\"]},\"1447\":{\"c\":[\"Research\"]},\"1448\":{\"h\":\"Linux Device Drivers | Concurrency and Race Conditions\"},\"1449\":{\"h\":\"<asm/semaphore.h> (not found)\",\"t\":[\"The include file that defines semaphores and the operations on them.\",\"DECLARE_MUTEX(name); DECLARE_MUTEX_LOCKED(name);\",\"Two macros for declaring and initializing a semaphore used in mutual exclusion mode.\",\"void init_MUTEX(struct semaphore *sem); void init_MUTEX_LOCKED(struct semaphore *sem);\",\"These two functions can be used to initialize a semaphore at runtime.\",\"void down(struct semaphore *sem); int down_interruptible(struct semaphore *sem); int down_trylock(struct semaphore *sem); void up(struct semaphore *sem);\",\"Lock and unlock a semaphore. down puts the calling process into an uninterruptible sleep if need be; down_interruptible, instead, can be interrupted by a signal. down_trylock does not sleep; instead, it returns immediately if the semaphore is unavailable. Code that locks a semaphore must eventually unlock it with up.\",\"struct rw_semaphore; init_rwsem(struct rw_semaphore *sem);\",\"The reader/writer version of semaphores and the function that initializes it.\",\"void down_read(struct rw_semaphore *sem); int down_read_trylock(struct rw_semaphore *sem); void up_read(struct rw_semaphore *sem);\",\"Functions for obtaining and releasing read access to a reader/writer semaphore.\",\"void down_write(struct rw_semaphore *sem) int down_write_trylock(struct rw_semaphore *sem) void up_write(struct rw_semaphore *sem) void downgrade_write(struct rw_semaphore *sem)\",\"Functions for managing write access to a reader/writer semaphore.\"]},\"1450\":{\"h\":\"<linux/completion.h>\",\"t\":[\"DECLARE_COMPLETION(name); init_completion(struct completion *c); INIT_COMPLETION(struct completion c);\",\"The include file describing the Linux completion mechanism, and the normal methods for initializing completions. INIT_COMPLETION should be used only to reinitialize a completion that has been previously used.\",\"void wait_for_completion(struct completion *c);\",\"Wait for a completion event to be signaled.\",\"void complete(struct completion *c); void complete_all(struct completion *c);\",\"Signal a completion event. complete wakes, at most, one waiting thread, while complete_all wakes all waiters.\",\"void complete_and_exit(struct completion *c, long retval);\",\"Signals a completion event by calling complete and calls exit for the current thread.\"]},\"1451\":{\"h\":\"<linux/spinlock.h>\",\"t\":[\"spinlock_t lock = SPIN_LOCK_UNLOCKED; spin_lock_init(spinlock_t *lock);\",\"The include file defining the spinlock interface and the two ways of initializing locks.\",\"void spin_lock(spinlock_t *lock); void spin_lock_irqsave(spinlock_t *lock, unsigned long flags); void spin_lock_irq(spinlock_t *lock); void spin_lock_bh(spinlock_t *lock);\",\"The various ways of locking a spinlock and, possibly, disabling interrupts.\",\"int spin_trylock(spinlock_t *lock); int spin_trylock_bh(spinlock_t *lock);\",\"Non-spinning versions of the above functions; these return 0 in case of failure to obtain the lock, nonzero otherwise.\",\"void spin_unlock(spinlock_t *lock); void spin_unlock_irqrestore(spinlock_t *lock, unsigned long flags); void spin_unlock_irq(spinlock_t *lock); void spin_unlock_bh(spinlock_t *lock);\",\"The corresponding ways of releasing a spinlock.\",\"rwlock_t lock = RW_LOCK_UNLOCKED; rwlock_init(rwlock_t *lock);\",\"The two ways of initializing reader/writer locks.\",\"void read_lock(rwlock_t *lock); void read_lock_irqsave(rwlock_t *lock, unsigned long flags); void read_lock_irq(rwlock_t *lock); void read_lock_bh(rwlock_t *lock);\",\"Functions for obtaining read access to a reader/writer lock.\",\"void read_unlock(rwlock_t *lock); void read_unlock_irqrestore(rwlock_t *lock, unsigned long flags); void read_unlock_irq(rwlock_t *lock); void read_unlock_bh(rwlock_t *lock);\",\"Functions for releasing read access to a reader/writer spinlock.\",\"void write_lock(rwlock_t *lock); void write_lock_irqsave(rwlock_t *lock, unsigned long flags); void write_lock_irq(rwlock_t *lock); void write_lock_bh(rwlock_t *lock);\",\"Functions for obtaining write access to a reader/writer lock.\",\"void write_unlock(rwlock_t *lock); void write_unlock_irqrestore(rwlock_t *lock, unsigned long flags); void write_unlock_irq(rwlock_t *lock); void write_unlock_bh(rwlock_t *lock);\",\"Functions for releasing write access to a reader/writer spinlock.\"]},\"1452\":{\"h\":\"<linux/rwsem.h>\",\"t\":[\"struct rw_semaphore; init_rwsem(struct rw_semaphore *sem);\",\"The reader/writer version of semaphores and the function that initializes it.\",\"void down_read(struct rw_semaphore *sem); int down_read_trylock(struct rw_semaphore *sem); void up_read(struct rw_semaphore *sem);\",\"Functions for obtaining and releasing read access to a reader/writer semaphore.\",\"void down_write(struct rw_semaphore *sem) int down_write_trylock(struct rw_semaphore *sem) void up_write(struct rw_semaphore *sem) void downgrade_write(struct rw_semaphore *sem)\",\"Functions for managing write access to a reader/writer semaphore.\"]},\"1453\":{\"c\":[\"Research\"]},\"1454\":{\"h\":\"Linux Device Drivers | Time, Delays, and Deferred Work\"},\"1455\":{\"h\":\"Timekeeping\"},\"1456\":{\"h\":\"<linux/param.h>\",\"t\":[\"HZ\",\"The HZ symbol specifies the number of clock ticks generated per second.\"]},\"1457\":{\"h\":\"<linux/jiffies.h>\",\"t\":[\"volatile unsigned long jiffies u64 jiffies_64\",\"The jiffies_64 variable is incremented once for each clock tick; thus, itâ€™s incremented HZ times per second. Kernel code most often refers to jiffies, which is the same as jiffies_64 on 64-bit platforms and the least significant half of it on 32-bit platforms.\",\"int time_after(unsigned long a, unsigned long b); int time_before(unsigned long a, unsigned long b); int time_after_eq(unsigned long a, unsigned long b); int time_before_eq(unsigned long a, unsigned long b);\",\"These Boolean expressions compare jiffies in a safe way, without problems in case of counter overflow and without the need to access jiffies_64.\",\"u64 get_jiffies_64(void);\",\"Retrieves jiffies_64 without race conditions.\"]},\"1458\":{\"h\":\"<linux/time.h>\",\"t\":[\"unsigned long timespec_to_jiffies(struct timespec *value); void jiffies_to_timespec(unsigned long jiffies, struct timespec *value); unsigned long timeval_to_jiffies(struct timeval *value); void jiffies_to_timeval(unsigned long jiffies, struct timeval *value);\",\"Converts time representations between jiffies and other representations.\"]},\"1459\":{\"h\":\"<asm/msr.h>\",\"t\":[\"rdtsc(low32,high32); rdtscl(low32); rdtscll(var64);\",\"x86-specific macros to read the timestamp counter. They read it as two 32-bit halves, read only the lower half, or read all of it into a long long variable.\"]},\"1460\":{\"h\":\"<linux/timex.h>\",\"t\":[\"cycles_t get_cycles(void);\",\"Returns the timestamp counter in a platform-independent way. If the CPU offers no timestamp feature, 0 is returned.\"]},\"1461\":{\"h\":\"<linux/time.h>\",\"t\":[\"unsigned long mktime(year, mon, day, h, m, s);\",\"Returns the number of seconds since the Epoch, based on the six unsigned int arguments.\",\"void do_gettimeofday(struct timeval *tv);\",\"Returns the current time, as seconds and microseconds since the Epoch, with the best resolution the hardware can offer. On most platforms the resolution is one microsecond or better, although some platforms offer only jiffies resolution.\",\"struct timespec current_kernel_time(void);\",\"Returns the current time with the resolution of one jiffy.\"]},\"1462\":{\"h\":\"Delays\"},\"1463\":{\"h\":\"<linux/wait.h>\",\"t\":[\"long wait_event_interruptible_timeout(wait_queue_head_t *q, condition, signed long timeout);\",\"Puts the current process to sleep on the wait queue, installing a timeout value expressed in jiffies. Use schedule_timeout (below) for non-interruptible sleeps.\"]},\"1464\":{\"h\":\"<linux/sched.h>\",\"t\":[\"signed long schedule_timeout(signed long timeout);\",\"Calls the scheduler after ensuring that the current process is awakened at timeout expiration. The caller must invoke set_current_state first to put itself in an interruptible or non-interruptible sleep state.\"]},\"1465\":{\"h\":\"<linux/delay.h>\",\"t\":[\"void ndelay(unsigned long nsecs); void udelay(unsigned long usecs); void mdelay(unsigned long msecs);\",\"Introduces delays of an integer number of nanoseconds, microseconds, and milliseconds. The delay achieved is at least the requested value, but it can be more. The argument to each function must not exceed a platform-specific limit (usually a few thousands).\",\"void msleep(unsigned int millisecs); unsigned long msleep_interruptible(unsigned int millisecs); void ssleep(unsigned int seconds);\",\"Puts the process to sleep for the given number of milliseconds (or seconds, in the case of ssleep).\"]},\"1466\":{\"h\":\"Kernel Timers\"},\"1467\":{\"h\":\"<asm/hardirq.h>\",\"t\":[\"int in_interrupt(void); int in_atomic(void);\",\"Returns a Boolean value telling whether the calling code is executing in interrupt context or atomic context. Interrupt context is outside of a process context, either during hardware or software interrupt processing. Atomic context is when you canâ€™t schedule either an interrupt context or a processâ€™s context with a spinlock held.\"]},\"1468\":{\"h\":\"<linux/timer.h>\",\"t\":[\"void init_timer(struct timer_list * timer); struct timer_list TIMER_INITIALIZER(_function, _expires, _data);\",\"This function and the static declaration of the timer structure are the two ways to initialize a timer_list data structure.\",\"void add_timer(struct timer_list * timer);\",\"Registers the timer structure to run on the current CPU.\",\"int mod_timer(struct timer_list *timer, unsigned long expires);\",\"Changes the expiration time of an already scheduled timer structure. It can also act as an alternative to add_timer.\",\"int timer_pending(struct timer_list * timer);\",\"Macro that returns a Boolean value stating whether the timer structure is already registered to run.\",\"void del_timer(struct timer_list * timer); void del_timer_sync(struct timer_list * timer);\",\"Removes a timer from the list of active timers. The latter function ensures that the timer is not currently running on another CPU.\"]},\"1469\":{\"h\":\"Tasklets\"},\"1470\":{\"h\":\"<linux/interrupt.h>\",\"t\":[\"DECLARE_TASKLET(name, func, data); DECLARE_TASKLET_DISABLED(name, func, data); void tasklet_init(struct tasklet_struct *t, void (*func)(unsigned long), unsigned long data);\",\"The first two macros declare a tasklet structure, while the tasklet_init function initializes a tasklet structure that has been obtained by allocation or other means. The second DECLARE macro marks the tasklet as disabled.\",\"void tasklet_disable(struct tasklet_struct *t); void tasklet_disable_nosync(struct tasklet_struct *t); void tasklet_enable(struct tasklet_struct *t);\",\"Disables and reenables a tasklet. Each disable must be matched with an enable (you can disable the tasklet even if itâ€™s already disabled). The function tasklet_disable waits for the tasklet to terminate if it is running on another CPU. The nosync version doesnâ€™t take this extra step.\",\"void tasklet_schedule(struct tasklet_struct *t); void tasklet_hi_schedule(struct tasklet_struct *t);\",\"Schedules a tasklet to run, either as a â€œnormalâ€ tasklet or a high-priority one. When soft interrupts are executed, high-priority tasklets are dealt with first, while normal tasklets run last.\",\"void tasklet_kill(struct tasklet_struct *t);\",\"Removes the tasklet from the list of active ones, if itâ€™s scheduled to run. Like tasklet_disable, the function may block on SMP systems waiting for the tasklet to terminate if itâ€™s currently running on another CPU.\"]},\"1471\":{\"h\":\"Workqueues\"},\"1472\":{\"h\":\"<linux/workqueue.h>\",\"t\":[\"struct workqueue_struct; struct work_struct;\",\"The structures representing a workqueue and a work entry, respectively.\",\"struct workqueue_struct *create_workqueue(const char *name); struct workqueue_struct *create_singlethread_workqueue(const char *name); void destroy_workqueue(struct workqueue_struct *queue);\",\"Functions for creating and destroying workqueues. A call to create_workqueue creates a queue with a worker thread on each processor in the system; instead, create_singlethread_workqueue creates a workqueue with a single worker process.\",\"DECLARE_WORK(name, void (*function)(void *), void *data); INIT_WORK(struct work_struct *work, void (*function)(void *), void *data); PREPARE_WORK(struct work_struct *work, void (*function)(void *), void *data);\",\"Macros that declare and initialize workqueue entries.\",\"int queue_work(struct workqueue_struct *queue, struct work_struct *work); int queue_delayed_work(struct workqueue_struct *queue, struct work_struct *work, unsigned long delay);\",\"Functions that queue work for execution from a workqueue.\",\"int cancel_delayed_work(struct work_struct *work); void flush_workqueue(struct workqueue_struct *queue);\",\"Use cancel_delayed_work to remove an entry from a workqueue; flush_workqueue ensures that no workqueue entries are running anywhere in the system.\",\"int schedule_work(struct work_struct *work); int schedule_delayed_work(struct work_struct *work, unsigned long delay); void flush_scheduled_work(void);\",\"Functions for working with the shared workqueue.\"]},\"1473\":{\"c\":[\"Research\"]},\"1474\":{\"h\":\"æ•°å­—å‡ ä½•å¤„ç† > 01-å¤§ä½œä¸š-å¼€é¢˜æŠ¥å‘Š\"},\"1475\":{\"h\":\"é€‰é¢˜èƒŒæ™¯\",\"t\":[\"é¢…é¢Œé¢ (Craniomaxillofacial, CMF) ç•¸å½¢åœ¨å…¨çƒèŒƒå›´å†…å½±å“ç€ä¼—å¤šæ‚£è€…çš„ç”Ÿæ´»è´¨é‡, æ­£é¢Œå¤–ç§‘æ‰‹æœ¯é€šè¿‡ç²¾ç¡®çš„éª¨éª¼åˆ‡å‰²ä¸é‡å®šä½, æ—¨åœ¨æ¢å¤é¢Œéª¨çš„æ­£å¸¸å½¢æ€. ç„¶è€Œ, ç”±äºé¢…é¢Œé¢åŒºåŸŸçš„å¤æ‚è§£å‰–ç»“æ„, æ‰‹æœ¯è§„åˆ’é¢ä